import logo from "./logo.svg";
import "./App.css";

import Card from "react-playing-card";

function App() {
  return (
    <div className="App">
      <div className="hand hhand-compact active-hand">
        <Card rank="A" suit="S" />
      </div>
    </div>
  );
}

export default App;
